dict.string:
ObjC.import("stdlib")
ObjC.import('AppKit')

const envDocuments = $.getenv("documents");
const action = $.getenv("action");
var { op, files, base: BASE } = JSON.parse(envDocuments);

if (action === "choose op") {
    op = $.getenv("op")
}

const App = Application.currentApplication();
App.includeStandardAdditions = true;

const ACTIONS = {
    pasteboard: (files) => {
        let message = []
        const pasteboard = $.NSPasteboard.generalPasteboard;
        pasteboard.clearContents;
        []
            .concat(files)
            .forEach((f) => {
                pasteboard.writeObjects([
                    ObjC.unwrap($.NSURL.fileURLWithPath(`${BASE}/${f}`)),
                ])
                message.push(`cp ${BASE}/${f} to pasteboard`)
            });
        return message.join(",")
    },
    move: (files) => {
        let message = []
        files.forEach((file) => {
            App.doShellScript(`mv "${BASE}/${file}" "${FinderPath()}"`)
            message.push(`mv "${BASE}/${file}" "${FinderPath()}"`)
        })
        return message.join(",")
    },
    copy: (files) => {
        let message = []
        files.forEach((file) => {
            App.doShellScript(`cp "${BASE}/${file}" "${FinderPath()}"`)
            message.push(`cp "${BASE}/${file}" "${FinderPath()}"`)
        })
        return message.join(",")
    },
};

const appName = Application('System Events').applicationProcesses.where({ frontmost: true }).name()[0]
let FinderPath;

if (appName !== 'Finder' && appName !== 'QSpace Pro') {
    'You need put Finder or QSpace Pro as your frontmost app'
} else {
    switch (appName) {
        case "QSpace Pro":
            getFullFolderPath = (path) => {
                // Import the necessary module
                ObjC.import('Foundation');

                // Convert the path to NSString
                var nsPath = $(path);

                // Create a file manager to check if the path is a directory
                var fileManager = $.NSFileManager.defaultManager;
                var isDirectory = Ref();

                // Check if the path is a directory
                fileManager.fileExistsAtPathIsDirectory(nsPath, isDirectory);

                if (isDirectory[0]) {
                    // If the path is a directory, return the path itself
                    return ObjC.unwrap(nsPath);
                } else {
                    // If the path is a file, return the path of its parent directory
                    var parentDirectory = nsPath.stringByDeletingLastPathComponent;
                    return ObjC.unwrap(parentDirectory);
                }
            }

            FinderPath = () => {
                const QSpacePro = Application("QSpace Pro");
                var selectedItems = QSpacePro.selectedItems();
                if (selectedItems.length > 0) {
                    return getFullFolderPath(decodeURIComponent(selectedItems[0].urlstr()).slice(7))
                } else {
                    return decodeURIComponent(QSpacePro.rootItem.urlstr()).slice(7)
                }
            };
            break;
        case "Finder":
            FinderPath = () =>
                decodeURI(
                    Application(appName)
                        .insertionLocation()
                        .url()
                        .replace(/^file:\/\//, '')
                );
            break;
    }

    ACTIONS[op](files);
}

