const op = $.getenv('op')
const file = $.getenv('file')

const App = Application.currentApplication();
App.includeStandardAdditions = true;

const ACTIONS = {
    move: (file) => {
        App.doShellScript(`mv "${file}" "${FinderPath()}"`)
        console.log(`mv "${file}" "${FinderPath()}"`)
        return `mv "${file}" "${FinderPath()}"`
    },
    copy: (file) => {
        App.doShellScript(`cp "${file}" "${FinderPath()}"`)
        console.log(`cp "${file}" "${FinderPath()}"`)
        return `cp "${file}" "${FinderPath()}"`
    },
};

